import React from 'react';
import './TextCarousel.css'; // Make sure to import your CSS file

const textLines = [
  "Line 1: Your text here",
  "Line 2: Your text here",
  "Line 3: Your text here",
  "Line 4: Your text here",
  "Line 5: Your text here",
  "Line 6: Your text here",
  "Line 7: Your text here",
  "Line 8: Your text here",
  "Line 9: Your text here",
  "Line 10: Your text here",
  "Line 11: Your text here",
  "Line 12: Your text here",
];

const TextCarousel = () => {
  return (
    <div className="text-carousel">
      <div className="carousel-inner">
        {textLines.map((line, index) => (
          <div className="text-line" key={index}>
            {line}
          </div>
        ))}
      </div>
    </div>
  );
};

export default TextCarousel;
